// Simulate API request.
(async () => {
  // Wait for global promise;
  await window.API_PROMISE;
  document.querySelector("#messages").insertAdjacentHTML(
    "beforeend",
    `
    <div>
    main processed global promise ${
      Date.now() - window.performance.timing.navigationStart
    }
    </div>
    `
  );

  // Load extensions.
  for (const letter of ["b", "c", "d"]) {
    const el = document.createElement("script");
    el.src = `./js/100kb.${letter}.js`;
    el.async = true;
    document.head.insertAdjacentElement("beforeend", el);
  }
})();
